import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p>World</p>
      <div id="future">

      </div>
      <form id="form" id="chat_form">
        <input id="chat_input" type="text"/>
        <input type="submit" value="Send"/>
      </form>

    </div>
  );
}

export default App;
